Dirbs patogiau A. Juknevičius sprendimą iš pagrindų atnaujinti sunkvežimį aiškina paprastai. „Tiesiog atėjo laikas. Mes jau negalėjome važiuoti su tuo pačiu sunkvežimiu – mes atrodėme tiesiog juokingai. Jei palygintumėte, kaip atrodė mūsų ir kitų komandų sunkvežimiai suprastumėte, kad mūsų buvo labai mažas. Mes tiesiog netilpdavome ir būdavo didelis diskomfortas. Dabar sąlygos bus kur kas geresnės“, – teigė A. Juknevičius. Be galybės įvairiausių detalių komanda iš viso į Dakarą vežasi net 35 atsarginius ratus. Apsisprendė greitai Kitų metų Dakare A. Juknevičiaus dešinėje ir toliau sėdės D.  Vaičiulis . „Jau po praėjusio Dakaro kaip ir sutarėme, kad planus dėl Antarktidos kiek atidėsiu“, – teigia patyręs keliautojas D. Vaičiulis. Kaunietis jau antrą kartą atideda planus kopti į aukščiausią Antarktidos kalbą, nes kopimui tinkamas tik vienas mėnuo – sausis. Tai būtent tas laikas, kad vyksta  Dakaro ralis . „Manau, kad galime savo bendrą rezultatą pagerinti 4 valandomis, o gal net ir šešiomis. Šiek tiek šiemet esame nugrybavę ir nuskraidę“, – teigė D. Vaičiulis. Stiprūs lietuviai A. Juknevičius neslėpė, kad didžioji kitų metų varžybų intriga – trys itin stiprūs lietuvių ekipažai. Be A. Juknevičiaus ir D. Vaičiulio, kitų metų Dakare varžysis Vaidotas Žala su Sauliumi Jurgelėnu ir Benediktas Vanagas su Sebastianu Rozwadowskiu. Visi lietuviai vairuos labai panašių specifikacijų „ Toyota Hilux  Overdrive“. „Šis Dakaras bus išskirtinis tuo, kad dar niekada Dakare nevažiavo net trys lietuviai, su tokiais pajėgiais automobiliais. Be to, bus ir vienas motociklininkas, tad lietuvių desantas Dakare bus išties didelis“, – sako A. Juknevičius. (function(d, s, i, r) {
